# ------------------ kategória-termék struktúra létrehozása ----------------------------------------
DROP  DATABASE IF EXISTS ITBOLT;
CREATE DATABASE ITBOLT;
USE ITBOLT;

# ---------------------- kategória, termék tábla létrehozása ----------------------------------------- 

CREATE TABLE  IT_kategoriak (
  ID_KATEGORIA int unsigned not null auto_increment,
  KATEGORIA    varchar(255) not null default '',
  PRIMARY KEY  (ID_KATEGORIA),
  UNIQUE KEY   (KATEGORIA)
) ENGINE=InnoDB ;

CREATE TABLE IT_termekek (
  ID_TERMEK     int unsigned not null auto_increment,
  ID_KATEGORIA  int unsigned not null default '0',
  NEV           varchar(255) not null default '',
  AZON          varchar(45)  not null default '',
  AR            int unsigned not null default '0',
  MENNYISEG     int unsigned not null default '0',
  MEEGYS        varchar(45)  not null default 'db',
  AKTIV         enum('N','Y') default 'Y' comment 'forgalmazott termék?',
  TERMEKLINK    varchar(255) not null default '', 
  FOTOLINK      varchar(255) not null default '', 
  LEIRAS        text         comment 'Megjegyzés',
  DATUMIDO      timestamp not null default current_timestamp on update current_timestamp,
  primary key (ID_TERMEK),
  index       (AZON),
  index       (NEV),
  index       (ID_KATEGORIA),
  fulltext    (LEIRAS),
  CONSTRAINT IT_kategoria_termek FOREIGN KEY (ID_KATEGORIA) REFERENCES IT_kategoriak (ID_KATEGORIA)         
) ENGINE=InnoDB ;


CREATE TABLE userek (
  ID_USER  int(11) unsigned NOT NULL auto_increment,
  NEV      varchar(100) NOT NULL default '' ,
  CIM      varchar(100) NOT NULL default '' ,
  TELEFON  varchar(100) NOT NULL default '' ,
  EMAIL    varchar(100) NOT NULL default '' , # bejelentkezési név, ide kap értesítést
  PASSWORD varchar(100) NOT NULL default '' , # md5 hash-el kódolva
  FUNKCIO  int(11) unsigned NOT NULL default 0 , 
  PRIMARY KEY  (ID_USER),
  UNIQUE KEY EMAIL (EMAIL))
ENGINE=InnoDB ;


CREATE TABLE rendeles (
  ID_RENDELES int(11) unsigned NOT NULL auto_increment,
  ID_USER   int(11) unsigned NOT NULL,
  IDSESSION  varchar(100)  NOT NULL default '',
  DATUMIDO timestamp NOT NULL default CURRENT_TIMESTAMP on update CURRENT_TIMESTAMP,
  FIZMOD   enum('készpénz','átutalás','csekk') NOT NULL default 'készpénz',
  SZALLMOD varchar(100)  NOT NULL default 'posta',
  ALLAPOT enum('folyamatban','lezárva','várakozik') NOT NULL default 'folyamatban',
  MEGJEGYZES text,
  PRIMARY KEY  (ID_RENDELES),
  KEY ID_USER (ID_USER),
  KEY IDSESSION (IDSESSION),
  CONSTRAINT u_r FOREIGN KEY (ID_USER) REFERENCES userek (ID_USER)
) ENGINE=InnoDB ;

CREATE TABLE rendeles_tetelei (
  ID_RENDTETEL  int(11) unsigned NOT NULL auto_increment,
  ID_RENDELES   int(11) unsigned NOT NULL,
  ID_TERMEK     int(11) unsigned NOT NULL,
  AR            int(11) unsigned NOT NULL default '0',
  MENNYISEG     int(11) NOT NULL default '1',
  PRIMARY KEY     (ID_RENDTETEL),
  KEY ID_RENDELES (ID_RENDELES),
  KEY ID_TERMEK (ID_TERMEK),
  unique key (ID_RENDELES, ID_TERMEK),
  CONSTRAINT kt_k FOREIGN KEY (ID_RENDELES) REFERENCES rendeles (ID_RENDELES) ON DELETE CASCADE,
  CONSTRAINT kt_t FOREIGN KEY (ID_TERMEK)   REFERENCES IT_termekek (ID_TERMEK)
) ENGINE=InnoDB ;

CREATE TABLE naplo (
  ID_NAPLO int(11) unsigned NOT NULL auto_increment,
  USER varchar(100)  NOT NULL default '',
  URL  varchar(100)  NOT NULL default '',
  SQLX  VARCHAR(1024) NOT NULL default '',
  DATUMIDO timestamp NOT NULL default CURRENT_TIMESTAMP on update CURRENT_TIMESTAMP,
  PRIMARY KEY  (ID_NAPLO)
) ENGINE=InnoDB ;


# ----------- trigger létrehozása új kategória KKULCS értékének kiolvasásához --------
CREATE TRIGGER ins_kategoria AFTER INSERT ON IT_kategoriak FOR EACH ROW SET @id=NEW.ID_KATEGORIA;
CREATE TRIGGER ins_rendeles  AFTER INSERT ON rendeles  FOR EACH ROW SET @id=NEW.ID_RENDELES;




